for file in models_scratch/base/base_salesforce/*.sql; do
  # Count columns in the final SELECT by counting lines that start with spaces and contain 'AS ' or end with a column reference
  # This counts each "column AS alias" or ", column" pattern
  basename_file=$(basename "$file")

  # Extract everything between SELECT and FROM (case insensitive), then count column separators (commas) + 1
  column_count=$(awk 'BEGIN{IGNORECASE=1; in_select=0} 
    /^[[:space:]]*SELECT[[:space:]]/ {in_select=1; next} 
    in_select && /^[[:space:]]*FROM[[:space:]]/ {in_select=0} 
    in_select && !/^[[:space:]]*--/ {
      # Count commas at the start of lines (which indicate columns)
      if ($0 ~ /^[[:space:]]*,/) count++
    }
    END {if (count > 0) print count+1; else print 0}' "$file")

  echo "$basename_file: $column_count"
done | sort -t: -k2 -rn

